    clock_out = (Time.parse('15:00') + ((i % 2) * 2).hours).strftime('%R')

    ActiveRecord::Base.connection.exec_query(
        "INSERT INTO Attendance(id, w_date, clock_in, clock_out, total_hours)
        VALUES('4', '#{date}', '#{clock_in}', '#{clock_out}', 4)"
    )
end
